import React from 'react';
import styled from "styled-components";

const Container= styled.div`
          height:50px;
          background-color:green;
`
const wrapper = styled.div`
        height:50px;
        background-color:green;
`

const Navbar = () => {
    return (
        <Container>
            <h1 >Navbar</h1>
        </Container>
    )
}

export default Navbar;
